import React from "react";

const Card = props => {
  const { name, email } = props;
  return (
    <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 cn">
      <img alt="photo" src={`https://robohash.org/${props.id}?150x150`} />
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  );
};

export default Card;
